import { Link } from "react-router-dom";

const EVENTS=[
    {id:'e1',title:'event 01'},
    {id:'e2',title:'event 02'},
    {id:'e3',title:'event 03'},
    {id:'e4',title:'event 04'},
    {id:'e5',title:'event 05'},
    {id:'e6',title:'event 06'},
]

function EventsPage() {
    return (
      <>
        <h1>Events Page</h1>
        <ul>
            {EVENTS.map(event=><li key={event.is}><Link to={`/events/${event.id}`}>{event.title}</Link></li>)}
        </ul>
      </>
    );
  }
  export default EventsPage;
